import React, {Component} from 'react';

class News extends Component {

    render() {
        const news_Array=[
            {id:"01",title:"这是标题1"},
            {id:"02",title:"这是标题2"},
            {id:"03",title:"这是标题3"},
            {id:"04",title:"这是标题4"}
        ]
        return (
            <div>
                {
                    news_Array.map((NewsObj)=>{
                        return `我的id是${NewsObj.id},我的标题是${NewsObj.title}`
                    })
                }
            </div>
        );
    }
}

export default News;
